(114, 2, 73, TIMESTAMP '2018-01-03 17:15:59.213', STRINGDECODE('TESTCER OR SYMPTOMATIC BREAST REFERRAL PATIENT STATUS is recorded to enable tracking of the status of REFERRAL REQUESTS for PATIENTS referred with a suspected TESTcer, or referred with breast symptoms with TESTcer not originally suspected.\nFor COSD this TEST be used for all patients regardless of referral route.'), TIMESTAMP '2018-01-03 17:16:00.325', NULL, NULL, 'testcerOrSymptomaticBreastReferralPatientStatus', 'FINALIZED', TIMESTAMP '2018-01-03 17:15:59.204', 1),
(115, 2, 73, TIMESTAMP '2018-01-03 17:15:59.266', STRINGDECODE('Record the time when the symptoms were first noted related to this diagnosis as agreed between the consultant and the patient.   Depending on the length of time this should normally include at least month and year. Day should also be included if known. If symptoms have been present for a long time then it may only be possible to record the year. This will normally be recorded by the consultant first seeing the patient in secondary care.\n\nIn these circumstances the Format/Length will be:\nDATE (including year, month and day) - CCYY-MM-DD\n    YEAR AND MONTH - YYYY-MM\n    Year only - YYYY.'), TIMESTAMP '2018-01-03 17:16:00.329', NULL, NULL, 'TESTCER SYMPTOMS FIRST NOTED DATE', 'FINALIZED', TIMESTAMP '2018-01-03 17:15:59.265', 1),
