(119, 2, 73, TIMESTAMP '2018-01-03 17:15:59.391', STRINGDECODE('*IMAGING CODE (NICIP)\nand/or\n (TESTCER IMAGING MODALITY and IMAGING ANATOMICAL SITE and ANATOMICAL SIDE (IMAGING))\nis required.\n\nIMAGING CODE (NICIP) is the National Interim Clinical Imaging Procedure Code Set code which is used to identify both the test modality and body site of the test.'), TIMESTAMP '2018-01-03 17:16:00.343', NULL, NULL, 'IMAGING CODE (NICIP)*', 'FINALIZED', TIMESTAMP '2018-01-03 17:15:59.391', 1),
