(121, 2, 73, TIMESTAMP '2018-01-03 17:15:59.437', STRINGDECODE('*IMAGING CODE (NICIP)\nand/or\n (TESTCER IMAGING MODALITY and IMAGING ANATOMICAL SITE and ANATOMICAL SIDE (IMAGING))\nis required.\n\nThe type of imaging procedure used during an Imaging or Radiodiagnostic Event for a TESTcer Care Spell.\nNB: PET STEST also includes PET-CT STEST.'), TIMESTAMP '2018-01-03 17:16:00.348', NULL, NULL, 'testcerImagingModality*', 'FINALIZED', TIMESTAMP '2018-01-03 17:15:59.429', 1);           
