(1, 0, FALSE, 'org.modelcatalogue.core.DataElement', 'contained in', 'A Data Element can be contained in multiple Data Classes. When a new draft of a Data Element is created, then drafts for all containing Data Classes are created as well.', NULL, 'containment', STRINGDECODE('String minOccursString = ext[''Min Occurs'']\n            String maxOccursString = ext[''Max Occurs'']\n\n            Integer minOccurs = minOccursString in [''unbounded'', ''null'', ''*'', null, ''''] ? 0 : (minOccursString as Integer)\n            Integer maxOccurs = maxOccursString in [''unbounded'', ''null'', ''*'', null, ''''] ? Integer.MAX_VALUE : (maxOccursString as Integer)\n\n            if (minOccurs < 0) {\n                return [\"relationshipType.containment.min.occurs.less.than.zero\", \"''Max Occurs'' has to be greater than zero\"]\n            }\n            if (maxOccurs < minOccurs) {\n                return [\"relationshipType.containment.min.occurs.greater.than.max.occurs\", \"The metadata ''Min Occurs'' cannot be greater than ''Min Occurs''\"]\n            }\n            if (maxOccurs < 1) {\n                return [\"relationshipType.containment.max.occurs.zero\", \"The metadata ''Max Occurs'' must be greater than zero\"]\n            }\n\n            return true'), FALSE, 'org.modelcatalogue.core.DataClass', 'contains', 'A Data Class can contain multiple Data Elements. Contained Data Elements are finalized when the Class is finalized.', FALSE, TRUE),
(2, 0, FALSE, 'org.modelcatalogue.core.CatalogueElement', 'is base for', 'A Catalogue Element can be base for multiple Catalogue Elements of the same type.', NULL, 'base', 'isSameClass()', FALSE, 'org.modelcatalogue.core.CatalogueElement', 'is based on', 'A Catalogue Element can be based on multiple Catalogue Elements of the same type. Value domains will first use rules of the base value domains and then their own when validating input values.', FALSE, TRUE),
(3, 0, FALSE, 'org.modelcatalogue.core.Asset', 'is attached to', 'An uploaded Asset can be attached to multiple Catalogue Elements.', NULL, 'attachment', NULL, FALSE, 'org.modelcatalogue.core.CatalogueElement', 'has attachment of', 'A Catalogue Element can have multiple uploaded Assets attached to it.', FALSE, FALSE),
(4, 0, FALSE, 'org.modelcatalogue.core.DataClass', 'child of', 'A Class can be contained (be child Class of) in multiple Classes. When a draft is created for child Class, drafts for parent Classes are created as well.', NULL, 'hierarchy', NULL, FALSE, 'org.modelcatalogue.core.DataClass', 'parent of', 'A Class can contain (be parent of) multiple Classes. Child Classes are finalized when parent Class is finalized.', FALSE, TRUE),
(5, 0, FALSE, 'org.modelcatalogue.core.CatalogueElement', 'supersedes', 'A Catalogue Element can be previous version (supersede) multiple Catalogue Elements of the same type.', NULL, 'supersession', 'isSameClass()', FALSE, 'org.modelcatalogue.core.CatalogueElement', 'superseded by', 'A Catalogue Element can have multiple previous versions which are Catalogue Elements of the same type.', TRUE, TRUE),
(6, 0, FALSE, 'org.modelcatalogue.core.CatalogueElement', 'is cloned from', 'A Catalogue Element can be origin for multiple cloned Catalogue Elements of the same type in different Data Models.', NULL, 'origin', 'isSameClass()', FALSE, 'org.modelcatalogue.core.CatalogueElement', 'is origin for', 'A Catalogue Element can be cloned from a single Catalogue Element of the same type.', TRUE, TRUE),
